import { div } from '@tensorflow/tfjs'
import React, { useEffect, useRef, useState } from 'react' 
import './ImageGenerator.css'
import default_image from '../Assets/default_image.png'
import { storage } from '../../firebase'
import { ref, uploadBytes, uploadString, listAll, getDownloadURL } from "firebase/storage"
import { v4 } from 'uuid'
import shape1 from "../Assets/shape-01.svg"
import shape2 from "../Assets/shape-02.svg"
import shape3 from "../Assets/shape-03.svg"
import shape4 from "../Assets/shape-04.svg"
import shape5 from "../Assets/shape-05.svg"
import shape6 from "../Assets/shape-06.svg"
import shape7 from "../Assets/shape-07.svg"
import shape8 from "../Assets/shape-08.svg"
import shape9 from "../Assets/shape-09.svg"
import shape10 from "../Assets/shape-10.svg"
import shape11 from "../Assets/shape-11.svg"
import shape12 from "../Assets/shape-12.svg"

function ImageGenerator() {

    //View States
    const [loading, setLoading] = useState(true);
    const [imageCreated, setImageCreated] = useState(r);
    const [picking, setPicking] = useState(r);
    const [pickingColor, setPickingColor] = useState(false);
    const [selectedShape, setSelectedShape] = useState(0);

    var remoteTestImageURL = "https://oaidalleapiprodscus.blob.core.windows.net/private/org-wTmsDuvjw0xVZ4SFQLXtPdXl/user-yWj9OiHuDcKQOhzYZ1c60eRe/img-qXON9FxTQmpqCaDmm9buYLVA.png?st=2023-12-05T15%3A00%3A38Z&se=2023-12-05T17%3A00%3A38Z&sp=r&sv=2021-08-06&sr=b&rscd=inline&rsct=image/png&skoid=6aaadede-4fb3-4698-a8f6-684d7786b067&sktid=a48cca56-e6da-484e-a814-9c849652bcb3&skt=2023-12-04T22%3A46%3A56Z&ske=2023-12-05T22%3A46%3A56Z&sks=b&skv=2021-08-06&sig=Y/Q79zyxrnJsKq/u9pAqpGqjcCmJxs2NpgmQartg1to%3D";

    const [imageList, setImageList] = useState([]);
    const imageListRef = ref(storage, "images/");
    const shapeArray = [shape1, shape2, shape3, shape4, shape5, shape6, shape7, shape8, shape9, shape10, shape11, shape12];

    var count = 0;

    const didPressSelector = (isLeft) => {
        if(isLeft) console.log("Pressed left!");
        else console.log("Pressed right!")
    }

    useEffect(() => {
        if(count > 0) return;
        listAll(imageListRef).then((response) => {
            console.log(response);
            response.items.forEach((item) => {
                getDownloadURL(item).then((url) => {
                    setImageList((prev) => [...prev,url]);
                })
            })
        });
        console.log("recorded");
        count++;
    }, []);

    const [imageUpload, setImageUpload] = useState(null);
    const uploadImage = () => {
        if (imageUpload == null ) return;
        const imageRef = ref(storage, `images/${v4()}`);

        // uploadBytes(imageRef, imageUpload).then(() => {
        //     alert("Image uploaded!");
        // })
        uploadString(imageRef,imageUpload, 'base64', {contentType: 'image/jpeg'}).then(() => {
            alert("Image uploaded!");
        })
    }    

    const [image_url,setImage_url] = useState("/");
    let inputRef = useRef(null);

    const imageGenerator = async () => {
        if(inputRef.current.value==="") {
            return 0;
        }
        setLoading(true);
        console.log(loading);
        testLoading();
        return;
        const response = await fetch(
            "https://api.openai.com/v1/images/generations",
            {
                method: "POST",
                headers: {
                    "Content-Type":"application/json",
                    Authorization: "Bearer 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",
                    "User-Agent":"Chrome",
                },
                body:JSON.stringify ({
                    prompt:`${inputRef.current.value}`,
                    n:1,
                    size:"512x512",
                    response_format: "b64_json"
                })
            }
        ); 
        let data = await response.json();
        console.log(data);
        let data_array = data.data;
        setImage_url(data_array[0].b64_json);
    }

    const testLoading = () => {
        console.log("Fake loading test");
        setTimeout(function() {
            console.log("Next step");
            setImageCreated(true);
            console.log(imageCreated);
            // setImage_url(data_array[0].b64_json);
        }, 2000);
    }

    var stickerShapeCount = 0;
    var stickerRandomNumber = 0;
    function getRandomInt(max) {
        return Math.floor(Math.random() * max);
      }

    return (
        <div className='ai-image-generator'>
            <div className={loading?"header fadeAway":"header"}>My wish for 2024 is...</div>
            <div className={!imageCreated?"header fadeAway":"header fadeIn"}>
                {(() => {
                    if(picking) {
                        return <span>Choose your shape</span>
                    } else if (pickingColor) {
                        return <span>Choose your color</span>
                    } else {
                        return <span>Your drawing!</span>
                    }
                })()}
            </div>
            <div className="img-loading">
            </div>
            <div className={!loading?"search-box":"search-box loading"}>
                <div className={imageCreated?"image":"image not-loaded"}><img id="imageid" src={image_url==="/"?default_image:"data:image/jpeg;base64,"+ image_url} alt="" /></div>

                <div className="shapeBox">
                    <img src={shapeArray[0]} alt="" />
                </div>
                <textarea className={!imageCreated?"search-input":"search-input not-loaded"} type="text" ref={inputRef} disabled={loading} placeholder='add your wish here...' />
            </div>
            <div className={picking?"customizationButtonBox":"display-none"} >
                <div className="customizationButton left">
                    <svg xmlns="http://www.w3.org/2000/svg" width="30" height="44" viewBox="0 0 30 44" fill="none">
                        <path d="M5.5 5L22.5 22L5.5 39" stroke="white" stroke-width="9.62264" stroke-linecap="round"/>
                    </svg>
                </div>
                <div className="customizationButton right">
                    <svg xmlns="http://www.w3.org/2000/svg" width="30" height="44" viewBox="0 0 30 44" fill="none">
                        <path d="M5.5 5L22.5 22L5.5 39" stroke="white" stroke-width="9.62264" stroke-linecap="round"/>
                    </svg>
                </div>
            </div>
            <div className="lowerButtonBox">
                <div className={loading?"generate-btn fadeAway":"generate-btn"} onClick={()=>{imageGenerator()}}>Draw my memory</div>
                <div className={picking?"display-none":""}>
                    <div className={!imageCreated?"generate-btn fadeAway":"generate-btn"} onClick={()=>{setPicking(true)}}>Next</div>
                    <div className={!imageCreated?"generate-btn fadeAway":"generate-btn"} onClick={()=>{imageGenerator()}}>try again</div>
                </div>
                <div className={loading&&!imageCreated?"header":"header fadeAway"} >drawing...</div>
                <div className="uploadTest-btn" onClick={()=>{
                    setImageUpload(image_url);
                    uploadImage();
                    }}>Upload</div>
            </div>
            <div className="stickerContainer">
            {imageList.map((url) => {
                console.log(url);
                stickerShapeCount++;
                return <div className={"sticker "  + (stickerShapeCount%3==2?" down":"") }>
                    <img className="stickerImage" src={url} />    
                    <img src={shapeArray[getRandomInt(12)]} alt="" className="stickerBackground " />
